$(document).ready((function(){$(".nav-group-container").each((function(){var e=$(this);e.find(".nav-item-wrapper.active").length>0?(e.addClass("open"),e.prev(".nav-section-label").addClass("open")):(e.hide(),e.removeClass("open"),e.prev(".nav-section-label").removeClass("open"))})),$(".nav-section-label").on("click",(function(){var e=$(this),n=e.next(".nav-group-container");n.is(":visible")?(n.slideUp(200),e.removeClass("open")):(n.slideDown(200),e.addClass("open"))}))}));